import React, { Component } from "react";
import { GridList, Grid, Container, GridListTile } from "@material-ui/core";

class Cart extends Component {
  render() {
    return (
      <Container>
        <h2>Cart</h2>

        <GridList
          cellHeight={200}
          style={{ marginRight: 100, marginLeft: 100 }}
          cols={1}
        >
          {["red", "yellow", "blue"].map(color => (
            <Grid container direction="row" style={{ background: color }}>
              <img
                src="https://salt.tikicdn.com/cache/175x175/ts/product/9c/ad/e4/1efb61539a6adcf2da14bd70b21ddf58.jpg"
                alt="Cart"
              />
              <Grid direction="column">
                <h3>Product name</h3>
                <h5>Information</h5>
              </Grid>
              <Button>Xoa</Button>
            </Grid>
          ))}
        </GridList>
      </Container>
    );
  }
}

export default Cart;

